import Chat_element from "./chat_element";
import React from "react";

function Chat_list(){
    return(
        <table>
            <caption>Ст*денты</caption>
            <tr>
                <th>ID</th>
                <th>Фамилия</th>
                <th>Имя</th>
                <th>Отчество</th>
            </tr>
            <tbody>
            {users.map(user => {
                return (
                    <Chat_element id={user.id} surname={user.surname} name={user.name}
                                  patronymic={user.patronymic}/>
                )
            })}
            </tbody>
        </table>
    )
}

export default Chat_list;
